import React, { Component } from "react";

class InfoDescription extends Component {
  state = {};
  render() {
    return (
      <div>
        <p>Five mythical Gift Kits</p>
        <h3>
          Crafted for gods, mortals, and mused alike, our new Gift Kit
          collection makes for inspired gift fiving this festive season.
        </h3>
        <button>Explore seasonal Gift Kit</button>
      </div>
    );
  }
}

export default InfoDescription;
